import React from 'react';
import '../../assetss/css/footer.css';
import '../../assetss/css/bootstrap.min.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// import {faFacebookSquare, faInstagramSquare , faLinkedin} from '@fortawesome/free-brands-svg-icons';

function Footer() {
    return (
        <div className="main-footer">
            soy el footer
            <div className="container">

                <div className="row" id="row-footer">

                    <div className="col text-center">

                    </div>

                    <div className="col text-center">
                        <h4>Redes</h4>                
                        
                        <div className="container">
                            <div className="row justify-content-center">

                                <div className="col" id="icono">
                                    {/* <a href="Facebook"><FontAwesomeIcon icon={faFacebookSquare} color="#6495ED" /></a> */}
                                </div>

                                <div className="col" id="icono">
                                    {/* <a href="Instagram"><FontAwesomeIcon icon={faInstagramSquare} color="#DDA0DD" /></a> */}
                                </div>

                                <div className="col" id="icono">
                                    {/* <a href="Twitter"><FontAwesomeIcon icon={faLinkedin} color="#6495ED" /></a> */}
                                </div>

                            </div>
                        </div>                        
                    </div>  

                </div>

                <hr></hr>

                <div className="footer-bottom">
                    <p className="text-center"> &copy; {new Date().getFullYear()} Turismo Real APP</p>
                </div>

            </div>

        </div>
    )
}

export default Footer;
